INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (488, 'application.yml', 'DEFAULT_GROUP', 'jasypt:\n  # 加解密密钥\n  encryptor:\n    # 根密码\n    password: dolphin\n\n# spring配置\nspring:\n  mvc:\n    pathmatch:\n      # swagger未适配spring5新的路径匹配策略path_pattern_parser,会报错需要改回旧的策略\n      matching-strategy: ant_path_matcher \n  redis:\n    database: 1\n    host: 127.0.0.1\n  cloud:\n    sentinel:\n      filter:\n        # 关闭内部拦截,与spring cloud 2021有不兼容的问题\n        enabled: false\n      # 取消Sentinel控制台懒加载\n      # 默认情况下 Sentinel 会在客户端首次调用的时候进行初始化,开始向控制台发送心跳包\n      # 配置 sentinel.eager=true 时,取消Sentinel控制台懒加载功能\n      eager: true\n      transport:\n        # Sentinel控制台地址,客户端需要通信时调用\n        dashboard: dolphin-visual-sentinel:8056\n\n# spring-boot-admin配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \"*\"\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# feign配置\nfeign:\n  # 开启对sentinel的支持能提供接口调用自动熔断降级的功能\n  sentinel:\n    enabled: true\n  # 开启okhttp\n  okhttp:\n    enabled: true\n  # 关闭feign默认使用的jdk中的HttpURLConnection请求性能太低,集成别的组件来替换掉\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        # 连接超时时间\n        connectTimeout: 10000\n        # 读超时时间\n        readTimeout: 10000\n  compression:\n    # 开启请求 GZIP 压缩,加快传输速度\n    request:\n      enabled: true\n    # 开启响应 GZIP 压缩,加快传输速度\n    response:\n      enabled: true\n\n# mybatis-plus配置\nmybatis-plus:\n  mapper-locations:\n    - classpath:mapper/**/*.xml\n  typeAliasesPackage: com.cloud.dolphin.**.entity  \n  global-config:\n    # 不显示banner\n    banner: false\n    # 数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\",ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: assign_id\n  configuration:\n    call-setters-on-nulls: true\n\n# spring security配置\nsecurity:\n  oauth2:\n    # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验\n    resource:\n      # 资源服务器负载均衡调用认证服务器\n      loadBalanced: true\n      # 认证服务器检测token地址\n      token-info-uri: http://dolphin-auth:3000/oauth/check_token\n    # 通用放行URL,服务个性化,授权资源,公开资源\n    ignore:\n      urls:\n        - /v2/api-docs\n        - /actuator/**\n\n# 防止XSS攻击\nxss:\n  # 过滤开关\n  enabled: false\n  # 排除链接（多个用逗号分隔）\n  # excludes:\n  # 匹配链接\n  urlPatterns: /system/*\n\n# swagger接口文档配置\nswagger:\n  enabled: true\n  title: 海豚微服务开放平台_接口文档\n  description: 海豚微服务开放平台\n  version: 1.0.0\n  terms-of-service-url: https://godolphinx.org\n  contact:\n    name: wangxaing4\n    email: 1827945911@qq.com\n  authorization:\n    name: dolphin-oauth\n    # 需要开启鉴权URL的正则,默认^.*$匹配所有URL\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: server all\n    token-url-list:\n      - http://${GATEWAY_HOST:dolphin-gateway}:${GATEWAY-PORT:9999}/auth_proxy/oauth/token\n\n# 日志配置\nlogging:\n  level:\n    com.cloud.dolphin: debug\n    org.springframework: WARN\n    org.spring.springboot.dao: debug', 'c76c226f06238bbe5f1b722fbf616058', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', '通用配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (489, 'dolphin-gateway.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    gateway:\n      # 开启跨域,放行任何跨域请求,开发环境可以允许网关工程跨域\n      globalcors:\n        corsConfigurations:\n          \'[/auth_proxy/**,/common_proxy/**]\':\n            allowedOriginPatterns: \"*\"\n            allowed-methods: \"*\"\n            allowed-headers: \"*\"\n            allow-credentials: true\n            exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n      # 自动根据服务ID建立路由\n      locator:\n        enabled: true\n      routes:\n        # 认证中心\n        - id: dolphin-auth\n          uri: lb://dolphin-auth\n          predicates:\n            - Path=/auth_proxy/**\n          filters:\n            # 验证码处理\n            - ValidateCodeGatewayFilter\n            # 前端密码解密\n            - PasswordDecoderFilter\n        # system 模块\n        - id: dolphin-system-biz\n          uri: lb://dolphin-system-biz\n          predicates:\n            - Path=/system_proxy/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                # 使用SpEL表达式从Spring容器中获取Bean对象,基于什么限流配置\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                # 限频的频率,每秒请求次数,设置每秒最大请求次数100\n                redis-rate-limiter.replenishRate: 100\n                # 系统按照恒定间隔向水桶里加入令牌,设置最大为200个令牌容量,如果没有令牌可拿,那么就拒绝服务。\n                redis-rate-limiter.burstCapacity: 200\n        # monitor 模块\n        - id: dolphin-monitor-biz\n          uri: lb://dolphin-monitor-biz\n          predicates:\n            - Path=/monitor_proxy/**\n        # common 模块\n        - id: dolphin-common-biz\n          uri: lb://dolphin-common-biz\n          predicates:\n            - Path=/common_proxy/**\n\ngateway:\n  # ASE对称加密密钥\n  encode-key: \'dolphin-platform\'\n  # 忽略不需要校验验证码是否合法的客户端\n  ignore-clients:\n    - test\n    - dolphin_lock\n\nswagger:\n  # 忽略微服务提供者\n  ignore-providers:\n    - dolphin-auth\n', '49d7fe730bd2b48062760db5268004ff', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', '网关配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (491, 'dolphin-system-biz.yml', 'DEFAULT_GROUP', 'security:\n  # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验,正在考虑换授权框架sa-token\n  oauth2:\n    client:\n      # 配置资源服务器去认证服务器token-info-uri认证所需的客户端ID跟客户端密钥\n      client-id: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      client-secret: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      scope: server\n\n# 阿里云短信\naliyun:\n  sms:\n    access-key-id: \'******\'\n    access-key-secret: \'******\'\n    sign-name: 海豚开发平台\n    templates:\n      ali-code:\n        templateCode: SMS_212690021\n\n# 文件上传相关 支持阿里云、华为云、腾讯、minio\noss:\n  endpoint: https://oss-cn-hangzhou.aliyuncs.com\n  access-Key: \'******\'\n  secret-Key: \'******\'\n  region: cn-hangzhou\n  path-style-access: false\n  bucket-name: \'******\'\n\nspring:\n  datasource:\n    hikari:\n      max-lifetime: 120000\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:root}\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true', '2eea59cc15b6f39b6f84bb973bd32ecf', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', '系统配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (492, 'dolphin-sentinel-dashboard.yml', 'DEFAULT_GROUP', '# spring-boot-admin 配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# spring-boot内置logback 配置\nlogging:\n  level:\n    org:\n      springframework:\n        web: info\n  file:\n    # 指定日志文件的位置\n    name: ${user.home}/logs/csp/sentinel-dashboard.log\n  pattern:\n    # 日志文件输出内容的格式\n    file: \'%d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\'\n\n# sentinel 安全配置\nauth:\n  username: sentinel\n  password: sentinel\n  filter:\n    exclude-urls: /,/auth/login,/auth/logout,/registry/machine,/version,/actuator/**,/details\n    exclude-url-suffixes: htm,html,js,css,map,ico,ttf,woff,png\n\nsentinel:\n  dashboard:\n    # 配置 sentinel 控制台版本号\n    version: 1.8.0', '523adc5f943c5f7cd3563657ebe9d0e4', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', 'sentinel监控', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (493, 'dolphin-xxl-job-admin.yml', 'DEFAULT_GROUP', '# spring-boot-admin配置\nmanagement:\n  health:\n    # 关闭邮件健康检查\n    mail:\n      enabled: false\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\nxxl:\n  job:\n    i18n: zh_CN\n    # 日志保留天数\n    logretentiondays: 30\n    # 调度线程池最大线程配置\n    triggerpool:\n      # 配置快任务线程池最大200\n      fast.max: 200\n      # 1分钟窗口期内任务耗时达500ms超过10次,该窗口期内断定为慢任务,慢任务自动降级进入 Slow 线程池,避免耗尽调度线程,提升系统稳定性,配置最大200\n      slow.max: 200\n\nmybatis:\n  mapper-locations: classpath:/mybatis-mapper/*Mapper.xml\n\nspring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB:dolphin_job}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:root}\n  mvc:\n    static-path-pattern: /static/**\n  freemarker:\n    suffix: .ftl\n    request-context-attribute: request\n    settings:\n      number_format: 0.##########\n  # xxl-job报警邮箱\n  mail:\n    host: smtp.qq.com\n    port: 465\n    from: 1827945911@qq.com\n    username: 1827945911@qq.com\n    password: xxxx\n    properties:\n      mail:\n        smtp:\n          auth: true\n          ssl.enable: true\n          starttls.enable: false\n          required: false', 'a9f068e5413ab34f2e27b362af99825f', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', 'xxl-job分布式定时器配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (494, 'dolphin-rocketmq-dashboard', 'DEFAULT_GROUP', '# spring-boot-admin 配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# spring-boot内置logback 配置\nlogging:\n  level:\n    org:\n      springframework:\n        web: info\n  file:\n    # 指定日志文件的位置\n    name: ${user.home}/logs/rocketmq/rocketmq-dashboard.log\n  pattern:\n    # 日志文件输出内容的格式\n    file: \'%d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\'\n\nrocketmq:\n  config:\n    # if this value is empty,use env value rocketmq.config.namesrvAddr  NAMESRV_ADDR | now, default localhost:9876\n    # configure multiple namesrv addresses to manage multiple different clusters\n    namesrvAddrs:\n      - xxx.xxx.xxx.xxx:9876\n    # if you use rocketmq version < 3.5.8, rocketmq.config.isVIPChannel should be false.default true\n    isVIPChannel:\n    # timeout for mqadminExt, default 5000ms\n    timeoutMillis:\n    # rocketmq-console\'s data path:dashboard/monitor\n    dataPath: /tmp/rocketmq-console/data\n    # set it false if you don\'t want use dashboard.default true\n    enableDashBoardCollect: true\n    # set the message track trace topic if you don\'t want use the default one\n    msgTrackTopicName:\n    ticketKey: ticket\n    # must create userInfo file: ${rocketmq.config.dataPath}/users.properties if the login is required\n    loginRequired: false\n    useTLS: false\n    # set the accessKey and secretKey if you used acl,外网使用需要开启ACL权限,我们是在内网玩的,不需要配置\n    accessKey: # if version > 4.4.0\n    secretKey: # if version > 4.4.0\n\nthreadpool:\n  config:\n    coreSize: 10\n    maxSize: 10\n    keepAliveTime: 3000\n    queueSize: 5000\n', 'cfea7e432a8272d132bd99aa70692eb5', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', 'rocketmq监控面板配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (495, 'dolphin-auth.yml', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    hikari:\n      max-lifetime: 120000\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:root}\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n  freemarker:\n    allow-request-override: false\n    allow-session-override: false\n    cache: true\n    charset: UTF-8\n    check-template-location: true\n    content-type: text/html\n    enabled: true\n    expose-request-attributes: false\n    expose-session-attributes: false\n    expose-spring-macro-helpers: true\n    prefer-file-system-access: true\n    suffix: .ftl\n    template-loader-path: classpath:/templates/\n', '0d44094c548ded4eaea353394e37237b', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', '认证中心配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (496, 'dolphin-monitor-biz', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    hikari:\n      max-lifetime: 120000\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:root}\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n', '56caae0f1f354d0407fbc4f5f435ec35', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', '运维监控配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (497, 'dolphin-common-biz', 'DEFAULT_GROUP', 'security:\n  # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验,正在考虑换授权框架sa-token\n  oauth2:\n    client:\n      # 配置资源服务器去认证服务器token-info-uri认证所需的客户端ID跟客户端密钥\n      client-id: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      client-secret: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      scope: server\n      \nspring:\n  datasource:\n    hikari:\n      max-lifetime: 120000\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:root}\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n', '9b7be538206c8fa924966a36fe19e105', '2023-01-15 23:16:52', '2023-01-15 23:16:52', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-dev', '通用业务配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (498, 'application.yml', 'DEFAULT_GROUP', 'jasypt:\n  # 加解密密钥\n  encryptor:\n    # 根密码\n    password: dolphin\n\n# spring配置\nspring:\n  mvc:\n    pathmatch:\n      # swagger未适配spring5新的路径匹配策略path_pattern_parser,会报错需要改回旧的策略\n      matching-strategy: ant_path_matcher \n  redis:\n    database: 0\n    host: xxx.xxx.xxx.xxx\n    port: 6379\n    password: \'******\'\n  cloud:\n    sentinel:\n      filter:\n        # 关闭内部拦截,与spring cloud 2021有不兼容的问题\n        enabled: false\n      # 取消Sentinel控制台懒加载\n      # 默认情况下 Sentinel 会在客户端首次调用的时候进行初始化,开始向控制台发送心跳包\n      # 配置 sentinel.eager=true 时,取消Sentinel控制台懒加载功能\n      eager: true\n      transport:\n        # Sentinel控制台地址,客户端需要通信时调用\n        dashboard: dolphin-visual-sentinel:8056\n\n# spring-boot-admin配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \"*\"\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# feign配置\nfeign:\n  # 开启对sentinel的支持能提供接口调用自动熔断降级的功能\n  sentinel:\n    enabled: true\n  # 开启okhttp\n  okhttp:\n    enabled: true\n  # 关闭feign默认使用的jdk中的HttpURLConnection请求性能太低,集成别的组件来替换掉\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        # 连接超时时间\n        connectTimeout: 10000\n        # 读超时时间\n        readTimeout: 10000\n  compression:\n    # 开启请求 GZIP 压缩,加快传输速度\n    request:\n      enabled: true\n    # 开启响应 GZIP 压缩,加快传输速度\n    response:\n      enabled: true\n\n# mybatis-plus配置\nmybatis-plus:\n  mapper-locations:\n    - classpath:mapper/**/*.xml\n  typeAliasesPackage: com.cloud.dolphin.**.entity  \n  global-config:\n    # 不显示banner\n    banner: false\n    # 数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\",ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: assign_id\n  configuration:\n    call-setters-on-nulls: true\n\n# spring security配置\nsecurity:\n  oauth2:\n    # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验\n    resource:\n      # 资源服务器负载均衡调用认证服务器\n      loadBalanced: true\n      # 认证服务器检测token地址\n      token-info-uri: http://dolphin-auth:3000/oauth/check_token\n    # 通用放行URL,服务个性化,授权资源,公开资源\n    ignore:\n      urls:\n        - /v2/api-docs\n        - /actuator/**\n\n# 防止XSS攻击\nxss:\n  # 过滤开关\n  enabled: false\n  # 排除链接（多个用逗号分隔）\n  # excludes:\n  # 匹配链接\n  urlPatterns: /system/*\n\n# swagger接口文档配置\nswagger:\n  enabled: true\n  title: 海豚微服务开放平台_接口文档\n  description: 海豚微服务开放平台\n  version: 1.0.0\n  terms-of-service-url: https://godolphinx.org\n  contact:\n    name: wangxaing4\n    email: 1827945911@qq.com\n  authorization:\n    name: dolphin-oauth\n    # 需要开启鉴权URL的正则,默认^.*$匹配所有URL\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: server all\n    token-url-list:\n      - http://${GATEWAY_HOST:dolphin-gateway}:${GATEWAY-PORT:9999}/auth_proxy/oauth/token\n\n# 日志配置\nlogging:\n  level:\n    com.cloud.dolphin: debug\n    org.springframework: WARN\n    org.spring.springboot.dao: debug', 'db02b577fadba49d5c0176516393a1c5', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', '通用配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (499, 'dolphin-gateway.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    gateway:\n     # 自动根据服务ID建立路由\n      locator:\n        enabled: true\n      routes:\n        # 认证中心\n        - id: dolphin-auth\n          uri: lb://dolphin-auth\n          predicates:\n            - Path=/auth_proxy/**\n          filters:\n            # 验证码处理\n            - ValidateCodeGatewayFilter\n            # 前端密码解密\n            - PasswordDecoderFilter\n        # system 模块\n        - id: dolphin-system-biz\n          uri: lb://dolphin-system-biz\n          predicates:\n            - Path=/system_proxy/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                # 使用SpEL表达式从Spring容器中获取Bean对象,基于什么限流配置\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                # 限频的频率,每秒请求次数,设置每秒最大请求次数100\n                redis-rate-limiter.replenishRate: 100\n                # 系统按照恒定间隔向水桶里加入令牌,设置最大为200个令牌容量,如果没有令牌可拿,那么就拒绝服务。\n                redis-rate-limiter.burstCapacity: 200\n        # monitor 模块\n        - id: dolphin-monitor-biz\n          uri: lb://dolphin-monitor-biz\n          predicates:\n            - Path=/monitor_proxy/**\n        # common 模块\n        - id: dolphin-common-biz\n          uri: lb://dolphin-common-biz\n          predicates:\n            - Path=/common_proxy/**\n\n\ngateway:\n  # ASE对称加密密钥\n  encode-key: \'dolphin-platform\'\n  # 忽略不需要校验验证码是否合法的客户端\n  ignore-clients:\n    - test\n    - dolphin_lock\n\nswagger:\n  # 忽略微服务提供者\n  ignore-providers:\n    - dolphin-auth', '3d2abd07e88ea75732703a7ecd5eda0b', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', '网关配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (501, 'dolphin-system-biz.yml', 'DEFAULT_GROUP', 'security:\n  # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验,正在考虑换授权框架sa-token\n  oauth2:\n    client:\n      # 配置资源服务器去认证服务器token-info-uri认证所需的客户端ID跟客户端密钥\n      client-id: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      client-secret: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      scope: server\n\n# 阿里云短信\naliyun:\n  sms:\n    access-key-id: \'******\'\n    access-key-secret: \'******\'\n    sign-name: 海豚开发平台\n    templates:\n      ali-code:\n        templateCode: SMS_212690021\n\n# 文件上传相关 支持阿里云、华为云、腾讯、minio\noss:\n  endpoint: https://oss-cn-hangzhou.aliyuncs.com\n  access-Key: \'******\'\n  secret-Key: \'******\'\n  region: cn-hangzhou\n  path-style-access: false\n  bucket-name: \'******\'\n\nspring:\n  datasource:\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true', 'b697bafba57a50e42b60ebb16bc7376d', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', '系统配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (502, 'dolphin-sentinel-dashboard.yml', 'DEFAULT_GROUP', '# spring-boot-admin 配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# spring-boot内置logback 配置\nlogging:\n  level:\n    org:\n      springframework:\n        web: info\n  file:\n    # 指定日志文件的位置\n    name: ${user.home}/logs/csp/sentinel-dashboard.log\n  pattern:\n    # 日志文件输出内容的格式\n    file: \'%d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\'\n\n# sentinel 安全配置\nauth:\n  username: sentinel\n  password: sentinel\n  filter:\n    exclude-urls: /,/auth/login,/auth/logout,/registry/machine,/version,/actuator/**,/details\n    exclude-url-suffixes: htm,html,js,css,map,ico,ttf,woff,png\n\nsentinel:\n  dashboard:\n    # 配置 sentinel 控制台版本号\n    version: 1.8.0', '523adc5f943c5f7cd3563657ebe9d0e4', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', 'sentinel监控', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (503, 'dolphin-xxl-job-admin.yml', 'DEFAULT_GROUP', '# spring-boot-admin配置\nmanagement:\n  health:\n    # 关闭邮件健康检查\n    mail:\n      enabled: false\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\nxxl:\n  job:\n    i18n: zh_CN\n    # 日志保留天数\n    logretentiondays: 30\n    # 调度线程池最大线程配置\n    triggerpool:\n      # 配置快任务线程池最大200\n      fast.max: 200\n      # 1分钟窗口期内任务耗时达500ms超过10次,该窗口期内断定为慢任务,慢任务自动降级进入 Slow 线程池,避免耗尽调度线程,提升系统稳定性,配置最大200\n      slow.max: 200\n\nmybatis:\n  mapper-locations: classpath:/mybatis-mapper/*Mapper.xml\n\nspring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin_job}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n  mvc:\n    static-path-pattern: /static/**\n  freemarker:\n    suffix: .ftl\n    request-context-attribute: request\n    settings:\n      number_format: 0.##########\n  # xxl-job报警邮箱\n  mail:\n    host: smtp.qq.com\n    port: 465\n    from: 1827945911@qq.com\n    username: 1827945911@qq.com\n    password: xxxx\n    properties:\n      mail:\n        smtp:\n          auth: true\n          ssl.enable: true\n          starttls.enable: false\n          required: false', '9a48aef54fb696acdbcea6a85ea46349', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', 'xxl-job分布式定时器配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (504, 'dolphin-rocketmq-dashboard', 'DEFAULT_GROUP', '# spring-boot-admin 配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# spring-boot内置logback 配置\nlogging:\n  level:\n    org:\n      springframework:\n        web: info\n  file:\n    # 指定日志文件的位置\n    name: ${user.home}/logs/rocketmq/rocketmq-dashboard.log\n  pattern:\n    # 日志文件输出内容的格式\n    file: \'%d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\'\n\nrocketmq:\n  config:\n    # if this value is empty,use env value rocketmq.config.namesrvAddr  NAMESRV_ADDR | now, default localhost:9876\n    # configure multiple namesrv addresses to manage multiple different clusters\n    namesrvAddrs:\n      - xxx.xxx.xxx.xxx:9876\n    # if you use rocketmq version < 3.5.8, rocketmq.config.isVIPChannel should be false.default true\n    isVIPChannel:\n    # timeout for mqadminExt, default 5000ms\n    timeoutMillis:\n    # rocketmq-console\'s data path:dashboard/monitor\n    dataPath: /tmp/rocketmq-console/data\n    # set it false if you don\'t want use dashboard.default true\n    enableDashBoardCollect: true\n    # set the message track trace topic if you don\'t want use the default one\n    msgTrackTopicName:\n    ticketKey: ticket\n    # must create userInfo file: ${rocketmq.config.dataPath}/users.properties if the login is required\n    loginRequired: false\n    useTLS: false\n    # set the accessKey and secretKey if you used acl,外网使用需要开启ACL权限,我们是在内网玩的,不需要配置\n    accessKey: # if version > 4.4.0\n    secretKey: # if version > 4.4.0\n\nthreadpool:\n  config:\n    coreSize: 10\n    maxSize: 10\n    keepAliveTime: 3000\n    queueSize: 5000\n', 'cfea7e432a8272d132bd99aa70692eb5', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', 'rocketmq监控面板配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (505, 'dolphin-auth.yml', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n  freemarker:\n    allow-request-override: false\n    allow-session-override: false\n    cache: true\n    charset: UTF-8\n    check-template-location: true\n    content-type: text/html\n    enabled: true\n    expose-request-attributes: false\n    expose-session-attributes: false\n    expose-spring-macro-helpers: true\n    prefer-file-system-access: true\n    suffix: .ftl\n    template-loader-path: classpath:/templates/\n', 'bffdfe9f1d225f275cb48e0bad3fcdab', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', '认证中心配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (506, 'dolphin-monitor-biz', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true', 'bee6599a9b40b8885717eed78d1b9a77', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', '运维监控配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (507, 'dolphin-common-biz', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true', 'bee6599a9b40b8885717eed78d1b9a77', '2023-01-15 23:17:17', '2023-01-15 23:17:17', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-prod', '通用业务配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (508, 'application.yml', 'DEFAULT_GROUP', 'jasypt:\n  # 加解密密钥\n  encryptor:\n    # 根密码\n    password: dolphin\n\n# spring配置\nspring:\n  mvc:\n    pathmatch:\n      # swagger未适配spring5新的路径匹配策略path_pattern_parser,会报错需要改回旧的策略\n      matching-strategy: ant_path_matcher \n  redis:\n    database: 0\n    host: xxx.xxx.xxx.xxx\n    port: 6379\n    password: \'******\'\n  cloud:\n    sentinel:\n      filter:\n        # 关闭内部拦截,与spring cloud 2021有不兼容的问题\n        enabled: false\n      # 取消Sentinel控制台懒加载\n      # 默认情况下 Sentinel 会在客户端首次调用的时候进行初始化,开始向控制台发送心跳包\n      # 配置 sentinel.eager=true 时,取消Sentinel控制台懒加载功能\n      eager: true\n      transport:\n        # Sentinel控制台地址,客户端需要通信时调用\n        dashboard: dolphin-visual-sentinel:8056\n\n# spring-boot-admin配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \"*\"\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# feign配置\nfeign:\n  # 开启对sentinel的支持能提供接口调用自动熔断降级的功能\n  sentinel:\n    enabled: true\n  # 开启okhttp\n  okhttp:\n    enabled: true\n  # 关闭feign默认使用的jdk中的HttpURLConnection请求性能太低,集成别的组件来替换掉\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        # 连接超时时间\n        connectTimeout: 10000\n        # 读超时时间\n        readTimeout: 10000\n  compression:\n    # 开启请求 GZIP 压缩,加快传输速度\n    request:\n      enabled: true\n    # 开启响应 GZIP 压缩,加快传输速度\n    response:\n      enabled: true\n\n# mybatis-plus配置\nmybatis-plus:\n  mapper-locations:\n    - classpath:mapper/**/*.xml\n  typeAliasesPackage: com.cloud.dolphin.**.entity  \n  global-config:\n    # 不显示banner\n    banner: false\n    # 数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\",ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: assign_id\n  configuration:\n    call-setters-on-nulls: true\n\n# spring security配置\nsecurity:\n  oauth2:\n    # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验\n    resource:\n      # 资源服务器负载均衡调用认证服务器\n      loadBalanced: true\n      # 认证服务器检测token地址\n      token-info-uri: http://dolphin-auth:3000/oauth/check_token\n    # 通用放行URL,服务个性化,授权资源,公开资源\n    ignore:\n      urls:\n        - /v2/api-docs\n        - /actuator/**\n\n# 防止XSS攻击\nxss:\n  # 过滤开关\n  enabled: false\n  # 排除链接（多个用逗号分隔）\n  # excludes:\n  # 匹配链接\n  urlPatterns: /system/*\n\n# swagger接口文档配置\nswagger:\n  enabled: true\n  title: 海豚微服务开放平台_接口文档\n  description: 海豚微服务开放平台\n  version: 1.0.0\n  terms-of-service-url: https://godolphinx.org\n  contact:\n    name: wangxaing4\n    email: 1827945911@qq.com\n  authorization:\n    name: dolphin-oauth\n    # 需要开启鉴权URL的正则,默认^.*$匹配所有URL\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: server all\n    token-url-list:\n      - http://${GATEWAY_HOST:dolphin-gateway}:${GATEWAY-PORT:9999}/auth_proxy/oauth/token\n\n# 日志配置\nlogging:\n  level:\n    com.cloud.dolphin: debug\n    org.springframework: WARN\n    org.spring.springboot.dao: debug', 'db02b577fadba49d5c0176516393a1c5', '2023-01-15 23:17:36', '2023-01-15 23:17:36', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-test', '通用配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (509, 'dolphin-gateway.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    gateway:\n      # 开启跨域,放行任何跨域请求,开发环境可以允许网关工程跨域\n      globalcors:\n        corsConfigurations:\n          \'[/auth_proxy/**,/common_proxy/**]\':\n            allowedOriginPatterns: \"*\"\n            allowed-methods: \"*\"\n            allowed-headers: \"*\"\n            allow-credentials: true\n            exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n      # 自动根据服务ID建立路由\n      locator:\n        enabled: true\n      routes:\n        # 认证中心\n        - id: dolphin-auth\n          uri: lb://dolphin-auth\n          predicates:\n            - Path=/auth_proxy/**\n          filters:\n            # 验证码处理\n            - ValidateCodeGatewayFilter\n            # 前端密码解密\n            - PasswordDecoderFilter\n        # system 模块\n        - id: dolphin-system-biz\n          uri: lb://dolphin-system-biz\n          predicates:\n            - Path=/system_proxy/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                # 使用SpEL表达式从Spring容器中获取Bean对象,基于什么限流配置\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                # 限频的频率,每秒请求次数,设置每秒最大请求次数100\n                redis-rate-limiter.replenishRate: 100\n                # 系统按照恒定间隔向水桶里加入令牌,设置最大为200个令牌容量,如果没有令牌可拿,那么就拒绝服务。\n                redis-rate-limiter.burstCapacity: 200\n        # monitor 模块\n        - id: dolphin-monitor-biz\n          uri: lb://dolphin-monitor-biz\n          predicates:\n            - Path=/monitor_proxy/**\n        # common 模块\n        - id: dolphin-common-biz\n          uri: lb://dolphin-common-biz\n          predicates:\n            - Path=/common_proxy/**\n\ngateway:\n  # ASE对称加密密钥\n  encode-key: \'dolphin-platform\'\n  # 忽略不需要校验验证码是否合法的客户端\n  ignore-clients:\n    - test\n    - dolphin_lock\n\nswagger:\n  # 忽略微服务提供者\n  ignore-providers:\n    - dolphin-auth\n', '49d7fe730bd2b48062760db5268004ff', '2023-01-15 23:17:36', '2023-01-15 23:17:36', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-test', '网关配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (511, 'dolphin-system-biz.yml', 'DEFAULT_GROUP', 'security:\n  # 目前资源服务器远程校验令牌RemoteTokenServices类未实现,目前支持本地校验,正在考虑换授权框架sa-token\n  oauth2:\n    client:\n      # 配置资源服务器去认证服务器token-info-uri认证所需的客户端ID跟客户端密钥\n      client-id: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      client-secret: ENC(dtjFNJ20ocy3dpBwUqSbfA==)\n      scope: server\n\n# 阿里云短信\naliyun:\n  sms:\n    access-key-id: \'******\'\n    access-key-secret: \'******\'\n    sign-name: 海豚开发平台\n    templates:\n      ali-code:\n        templateCode: SMS_212690021\n\n# 文件上传相关 支持阿里云、华为云、腾讯、minio\noss:\n  endpoint: https://oss-cn-hangzhou.aliyuncs.com\n  access-Key: \'******\'\n  secret-Key: \'******\'\n  region: cn-hangzhou\n  path-style-access: false\n  bucket-name: \'******\'\n\nspring:\n  datasource:\n    # 数据源采用spring-boot自带kari,轻量化\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true', 'b697bafba57a50e42b60ebb16bc7376d', '2023-01-15 23:17:36', '2023-01-15 23:17:36', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-test', '系统配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (512, 'dolphin-sentinel-dashboard.yml', 'DEFAULT_GROUP', '# spring-boot-admin 配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# spring-boot内置logback 配置\nlogging:\n  level:\n    org:\n      springframework:\n        web: info\n  file:\n    # 指定日志文件的位置\n    name: ${user.home}/logs/csp/sentinel-dashboard.log\n  pattern:\n    # 日志文件输出内容的格式\n    file: \'%d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\'\n\n# sentinel 安全配置\nauth:\n  username: sentinel\n  password: sentinel\n  filter:\n    exclude-urls: /,/auth/login,/auth/logout,/registry/machine,/version,/actuator/**,/details\n    exclude-url-suffixes: htm,html,js,css,map,ico,ttf,woff,png\n\nsentinel:\n  dashboard:\n    # 配置 sentinel 控制台版本号\n    version: 1.8.0', '523adc5f943c5f7cd3563657ebe9d0e4', '2023-01-15 23:17:36', '2023-01-15 23:17:36', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-test', 'sentinel监控', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (513, 'dolphin-xxl-job-admin.yml', 'DEFAULT_GROUP', '# spring-boot-admin配置\nmanagement:\n  health:\n    # 关闭邮件健康检查\n    mail:\n      enabled: false\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\nxxl:\n  job:\n    i18n: zh_CN\n    # 日志保留天数\n    logretentiondays: 30\n    # 调度线程池最大线程配置\n    triggerpool:\n      # 配置快任务线程池最大200\n      fast.max: 200\n      # 1分钟窗口期内任务耗时达500ms超过10次,该窗口期内断定为慢任务,慢任务自动降级进入 Slow 线程池,避免耗尽调度线程,提升系统稳定性,配置最大200\n      slow.max: 200\n\nmybatis:\n  mapper-locations: classpath:/mybatis-mapper/*Mapper.xml\n\nspring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST:xxx.xxx.xxx.xxx}:${MYSQL_PORT:8052}/${MYSQL_DB:dolphin_job}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&nullCatalogMeansCurrent=true&allowPublicKeyRetrieval=true\n    username: ${MYSQL_USER:root}\n    password: ${MYSQL_PWD:******}\n  mvc:\n    static-path-pattern: /static/**\n  freemarker:\n    suffix: .ftl\n    request-context-attribute: request\n    settings:\n      number_format: 0.##########\n  # xxl-job报警邮箱\n  mail:\n    host: smtp.qq.com\n    port: 465\n    from: 1827945911@qq.com\n    username: 1827945911@qq.com\n    password: xxxx\n    properties:\n      mail:\n        smtp:\n          auth: true\n          ssl.enable: true\n          starttls.enable: false\n          required: false', '9a48aef54fb696acdbcea6a85ea46349', '2023-01-15 23:17:36', '2023-01-15 23:17:36', NULL, '0:0:0:0:0:0:0:1', '', 'dolphin-test', 'xxl-job分布式定时器配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (514, 'dolphin-rocketmq-dashboard', 'DEFAULT_GROUP', '# spring-boot-admin 配置\nmanagement:\n  endpoints:\n    web:\n      # 暴露所有监控点(监控请求url地址)配置\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      # 何时显示完整的健康信息,默认为NEVER都不显示,WHEN_AUTHORIZED当经过授权的用户显示,ALWAYS总是展示\n      show-details: ALWAYS\n\n# spring-boot内置logback 配置\nlogging:\n  level:\n    org:\n      springframework:\n        web: info\n  file:\n    # 指定日志文件的位置\n    name: ${user.home}/logs/rocketmq/rocketmq-dashboard.log\n  pattern:\n    # 日志文件输出内容的格式\n    file: \'%d{yyyy-MM-dd HH:mm:ss} [%thread] %-5level %logger{36} - %msg%n\'\n\nrocketmq:\n  config:\n    # if this value is empty,use env value rocketmq.config.namesrvAddr  NAMESRV_ADDR | now, default localhost:9876\n    # configure multiple namesrv addresses to manage multiple different clusters\n    namesrvAddrs:\n      - xxx.xxx.xxx.xxx:9876\n    # if you use rocketmq version < 3.5.8, rocketmq.config.isVIPChannel should be false.default true\n    isVIPChannel:\n    # timeout for mqadminExt, default 5000ms\n    timeoutMillis:\n    # rocketmq-console\'s data path:dashboard/monitor\n    dataPath: /tmp/rocketmq-console/data\n    # set it false if you don\'t want use dashboard.default true\n    enableDashBoardCollect: true\n    # set the message track trace topic if you don\'t want use the default one\n    msgTrackTopicName:\n    ticketKey: ticket\n    # must create userInfo file: ${rocketmq.config.dataPath}/users.properties if the login is required\n    loginRequired: false\n    useTLS: false\n    # set the accessKey and secretKey if you used acl,外网使用需要开启ACL权限,我们是在内网玩的,不需要配置\n    accessKey: # if version > 4.4.0\n    secretKey: # if version > 4.4.0\n\nthreadpool:\n  config:\n    coreSize: 10\n    maxSize: 10\n    keepAliveTime: 3000\n    queu